def Export(request): ## xuat cac anh tu trong database ra mot file
    if 'export' in request.POST:
        output = BytesIO()
        workbook = xlsxwriter.Workbook(output)
        wowksheet = workbook.add_worksheet('Risk Summaru')
        wowksheet1 = workbook.add_worksheet('Risk Summary Deltal')
        ## phong chu ##
        format = workbook.add_format()
        format.set_font_name('Time New Roman')
        format.set_font_size(14)

        format1 = workbook.add_format()
        format1.set_font_name('Time New Roman')
        format1.set_font_size(20)

        wowksheet.write('A1', 'Dia Chi IP', format1)
        wowksheet.write('A2', '010.111', format)
        wowksheet.write('A3', '000.192', format)
        wowksheet.write('A4', '111.244', format)
        wowksheet.write('A5', '555.733', format)

        wowksheet.write('B1', 'Du lieu hien thi', format1)
        wowksheet.write('B2', 'Du lieu hien thi', format)
        wowksheet.write('B3', 'Du lieu hien thi', format)
        wowksheet.write('B4', 'Du lieu hien thi', format)
        wowksheet.write('B5', 'Du lieu hien thi', format)

        wowksheet.write('C1', 'Du lieu hien thi', format1)
        wowksheet.write('C2', 'Du lieu hien thi', format)
        wowksheet.write('C3', 'Du lieu hien thi', format)
        wowksheet.write('C4', 'Du lieu hien thi', format)
        wowksheet.write('C5', 'Du lieu hien thi', format)

        workbook.close()
        output.seek(0)
        response = HttpResponse(output.read(), content_type="application/ms-excel")
        response['Content-Disposition'] = 'attackment ; filename = tuan.xlsx'
        return response
    return render(request,'testExport.html')

def profile(request): ## ham import anh vao database
    if request.method=='POST' and request.FILES['myfile']:
        encodeData=request.POST.get('encoderfile')
        data_encode = str(encodeData).replace('<img src="data:image/jpeg;base64,', '').replace(
            '<img src="data:image/png;base64,', '').replace('">', '')    #loai bo thong tin du thua
        #tao doi tuong moi#
        newNew=models.Img(img=data_encode)
        newNew.save()
    return render(request,'img.html')

